import React from 'react';

const Content = (props) => {
    return(
        <content className="content">
            <h1>Kerkelijke Trouw</h1>
            <p>
                Onze kerkelijke trouw zal doorgaan in de Sint-Pieterskerk in gent.
             </p>
             <p>
                Deze prachtige kerk is gelegen op het Sint-Pietersplein.
            </p>   
            <p>
                Deze kerk ligt vlak naast de faculteit Economie & Bedrijfskunde waar wij elkaar ontmoet hebben.
            </p>
            <p>
                Adres: Sint-Pietersplein, 9000 Gent<br></br>
                Tijdstip: 14u00.
            </p>

        </content>

    );
};

export default Content;
